header
{
    background-image: url('../../images/xhome-banner.jpg.pagespeed.ic.mZauGRJbmf.webp');
    background-repeat: no-repeat;
    background-position: center;
    background-size: cover;
    position: relative;
    width: 100%;
    max-height: 830px;
    height: 830px;
    display: flex;
    flex-direction: column;
    align-items: center;
    @include media('tab-land')
    {
        height: 620px;
        min-height: 620px;
    }
    .Header
    {
        background-color: transparent;
        position: fixed;
        padding: 0;
        top:0;
        left:0;
        z-index: 5;
        width: 100vw;
        height: 80px;
        @include media('tab-land')
        {
            background-color: $secondary-color-light;
        }
        .nav-toggle
        {
            background-color: transparent;
            color: transparent;
            line-height: 0;
            padding: 0;
            &-icon
            {
                display: inline-block;
                width: 25px;
                border-radius: 20px;
                height: 3px;
                background-color: $primary-color;
                position: relative;
                &::after
                {
                    content: '';
                    display: inline-block;
                    position: absolute;
                    left: 0;
                    top: 6px;
                    width: 25px;
                    border-radius: 20px;
                    height: 3px;
                    background-color: $primary-color;
                    transform: rotate(0deg) translateX(0px);
                    transition: transform 500ms ease-in-out;
                }
                &::before
                {
                    @extend .nav-toggle-icon::after;
                    top: -6px;
                }
                &.active
                {
                    background-color: transparent;
                    &::after
                    {
                        transform: rotate(50deg) translateX(-7px);
                    }
                    &::before
                    {
                        transform: rotate(-50deg) translateX(-8px);
                    }
                }
            }
        }
        .nav-items
        {
            display: flex;
            align-items: center;
            &-item
            {
                margin-right: 1rem;
                position: relative;
                &:last-of-type
                {
                    margin-right: 0;
                }
                .nav-item-link
                {
                    @extend %liStyle;
                }
                .nav-item-link.active
                {
                    color: $primary-color;
                }
            }       
            &-item::after
            {
                @extend %liHoverHeader;
            }
            &-item:hover::after, &-item.active::after
            {
                opacity: 1;
                width: 100%;
            }
            &-item:hover .nav-item-link
            {
                color: $primary-color;
            }
            .item-space
            {
                margin-right: 1rem;
            }
            // li.Blog to appear dropDown
            .Blog
            {
                &-dropDown
                {
                    width: 210px;
                    display: flex;
                    flex-direction: column;
                    position: absolute;
                    top:100%;
                    left: -40px;
                    box-shadow: 1px 1px 3px rgba($secondary-color,0.1);
                    pointer-events: none;
                    opacity: 0;
                    transform: translateY(40px);
                    transition: transform 500ms ease-in-out;
                    &-item
                    {
                        padding:1rem;
                        width: 100%;
                        border-bottom: 1px solid rgba($primary-light-color,.6);
                        background-color: white;
                        transition: background-color 200ms ease-in-out;
                        cursor: pointer;
                        a
                        {
                            color: $secondary-color-dark;
                            font-weight: 700;
                            text-transform: uppercase;
                            font-size: .75rem;
                            transition: color 200ms ease-in-out;
                        }
                        &:hover
                        {
                            background-color: $primary-color;
                        }
                        &:hover a
                        {
                        color:$secondary-color-light;
                        }
                    }
                }
                &:hover .Blog-dropDown
                {
                    opacity: 1;
                    transform: translateY(21px);
                    pointer-events: visible;
                }
            }
        }
        .Seacrh
        {
            display: flex;
            justify-content: center;
            #searchBtn
            {
                background-color: transparent;
                margin-left:5rem;
                text-align: center;
                @include media('tab-port')
                {
                    margin-left:0;
                }
                i
                {
                    color: $secondary-color-dark;
                    font-weight: 600;
                }
            }
        }
    }
    .mob-items 
    {
        background-color: $secondary-color-light;
        padding: 1rem;
        display: flex;
        flex-direction: column;
        align-items: flex-start;
        height: 350px;
        position: relative;
        margin-top: 80px;
        overflow-y:scroll ;
        &-item
        {
            margin-bottom: 1rem;
            &-link
            {
                color:$secondary-color;
                font-size: .75rem;
                font-weight: 600;
            }
            &:hover a , &:focus a
            {
                color: $primary-color;
            }
            &.active a
            {
                color: $primary-color;
            }
        }
        .Blog-mob
        {
            .Blog-dropDown
            {
                    width: 90vw;
                    display: flex;
                    flex-direction: column;
                    box-shadow: 1px 1px 10px rgba($primary-light-color,0.5);
                    padding: 0rem 1rem 0 1rem;
                    margin-top: 1rem;
                    &-item
                    {
                        padding:1rem;
                        width: 100%;
                        border-bottom: 1px solid rgba($primary-light-color,.5);
                        transition: background-color 200ms ease-in-out;
                        cursor: pointer;
                        a
                        {
                            color: $secondary-color-dark;
                            font-weight: 600;
                            text-transform: uppercase;
                            font-size: .75rem;
                            transition: color 200ms ease-in-out;
                        }
                        &:hover
                        {
                            background-color: $primary-color;
                        }
                        &:hover a
                        {
                        color:$secondary-color-light;
                        }
                    }
                
            }
        }
    }
    .Search-div
    {
        opacity: 0;
        pointer-events: none;
        position: absolute;
        top: 80px;
        overflow: hidden;
        transition: opacity 500ms ease-in-out;
        &.active
        {
        opacity: 1;
        pointer-events: visible;
        }
        #searchInput
        {
            padding: .2rem 1rem;
            background-color: $primary-color;
            display: flex;
            justify-content: space-between;
            align-items: center;
            width: 100%;
            height: 100%;
            margin:0 0;
            transform:translateY(-90px);
            transform-origin:top;
            transition:transform 900ms ease-in-out;
            &.active
            {
                transform:translateY(0px);
            }
            input
            {
                border: none;
                background-color: transparent;
                outline: none;
                display: inline-block;
                color: $secondary-color-light;
                font-size: .8rem;
                font-weight: 600;
                letter-spacing: .03rem;
                width: 70%;
            }
            button
            {
                background-color: transparent;
                color:$secondary-color-light;
                width: auto;
                font-size: 1.4rem;
                font-weight: 600;
            }
        }

    }
    .Banner-info
    {
        display: flex;
        @include media('phone')
        {
            align-items: center;
            height: 100%;
            margin-left: auto;
            margin-right: auto;
            width: 100%;
            max-width: 540px;
        }
        .social
        {
            transform: rotate(-90deg);
            display: flex;
            padding-left: 0;
            align-items: flex-start;
            margin-left: -55%;
