.main-sec1
{
    position: relative;
    margin-top: 5rem;
    &-filter
    {
        &-toggle
        {
            margin-bottom: 1.875rem;
            li
            {
                margin-right: 2.5rem;
                @extend %liStyle;
                cursor: pointer;
                position: relative;
            }
            li::after
            {
                @extend %liHoverHeader;
                transform: translateX(-4px);
            }
            li:hover::after, li.active::after
            {
                opacity: 1;
                width: 150%;
            }
            li.active,li:hover,li:focus
            {
                color: $primary-color;
            }
        }
        &-sec
        {
            display: grid;
            grid-template-columns: 1fr 2fr;
            grid-gap:50px ;
            &-item
            {
                position: relative;
                padding: 0;
                &-Secimg
                {
                    width: 100%;
                    height: 100%;
                    img
                    {
                        width: 100%;
                        height: 100%;
                    }
                }
                &-info
                {
                    position: absolute;
                    bottom: 0;
                    left: 0;
                }
            }
            .item-2
            {
                grid-column-start:2;
                grid-column-end:4;
                grid-row-start: 1;
                grid-row-end: 3;
            }
            .item-4
            {
                max-height: 390px;
                height: 390px;
                grid-column-start:2;
                grid-column-end:4;
                grid-row-start: 3;
                grid-row-end: 5;
            }
            .item-1,.item-3,.item-5
            {
                grid-column-start:1;
                grid-column-end:2;
                align-self: start;
            }
            .item-1
            {
                grid-row: 1/2;
            }
            .item-3
            {
                grid-row: 2/4;
            }
            .item-5
            {
                max-height: 541px;
                height: 541px;
                grid-row: 3/6;
                margin-top: -35%;
            }
        }
    }
}

